import React, { useState } from 'react'
import './index.css'

const Basket = ({ onClickBasket,items }) => {
	
	const [inputValue, setInputValue] = useState();


	return (
	<div className='container_basket' >
		<div className='aside_basket'>
			<div className='row_aside'>
				<div className='row_header'>
					<h1>Корзина</h1>
						<img onClick={onClickBasket} src='https://cdn-icons-png.flaticon.com/128/70/70206.png' style={{ cursor: 'pointer' }} width='50px' height='50px'/>
				</div>
					{(items.map((item, index) =>
						<div className='aside'
							key={index}>
							<img src={item.imageUrl} width='60px' height='60px' />
							<input
								value={item.name}
								onChange={e => setInputValue(e.target.value)}
							/>
							<p>{item.price}</p>
							<img src='https://cdn-icons-png.flaticon.com/128/70/70206.png' style={{ cursor: 'pointer' }} width='30px' height='30px' />
						</div>
				))}
			</div>
		</div>
	</div>

  )
}

export default Basket
